import views from "./Button.module.scss";
const Button = (props) => {
	// const handleClick = (e) => {
	// 	const target = e.target;
	// 	target.className == views.unClicked
	// 		? (target.className = views.clicked)
	// 		: (target.className = views.unClicked);
	// };
	return (
		<div className={views.container}>
			<button className={views.unClicked}>{props.children}</button>
		</div>
	);
};

export default Button;
